// src/users/Business.js
import React, { Component } from 'react';
import Communication from '../communication/Communication';
import Donations from '../donation_coordination/Donations';
import Waste from '../waste_analyses/WasteA';
import Notifications from '../notifications/Notification';
import ExpiryManager from '../expiry_manager/ExpiryManager';

class Business extends Component {
  render() {
    return (
      <div style={{ padding: '20px' }}>
        <h2>Business Dashboard</h2>
        <p>Manage donations, expiry items, waste analytics, and more.</p>

        <Communication />
        <Donations />
        <Waste />
        <Notifications />
        <ExpiryManager />
      </div>
    );
  }
}

export default Business;
